class StackedImages {
    private var images: [UIImage] = []
    private var iconScale: CGFloat = 0.70

    init(images: [UIImage], iconScale: CGFloat = 0.70) {
        self.images = images
        self.iconScale = iconScale
    }

    func stackImages() -> UIImage {
        let stackedImage = UIImage()
        for (index, image) in images.enumerated() {
            let scaledImage = image.scaleImage(toSize: CGSize(width: image.size.width * iconScale, height: image.size.height * iconScale))
            let scaledImageView = UIImageView(image: scaledImage)
            scaledImageView.frame = CGRect(x: 0, y: 0, width: scaledImage.size.width, height: scaledImage.size.height)
            stackedImage.addSubview(scaledImageView)
            if index == 0 {
                scaledImageView.frame.origin.x = (stackedImage.frame.width - scaledImage.size.width) / 2
                scaledImageView.frame.origin.y = (stackedImage.frame.height - scaledImage.size.height) / 2
            } else if index == 1 {
                scaledImageView.frame.origin.x = (stackedImage.frame.width - scaledImage.size.width) / 2
                scaledImageView.frame.origin.y = (stackedImage.frame.height - scaledImage.size.height) / 2 + scaledImage.size.height
            }
        }
        return stackedImage
    }
}

